import { FC, useState, useEffect } from "react";
import { Avatar, Button, Card, Tabs, Typography, Row, Col, Form, Input, List, Tag, Badge, Space, Divider, Table, Progress, Checkbox, Select } from "antd";
import { UserOutlined, HistoryOutlined, HeartOutlined, SettingOutlined, EditOutlined, PhoneOutlined, MailOutlined, LockOutlined, StarFilled, CheckCircleFilled, ClockCircleFilled } from "@ant-design/icons";
import { useLocation } from "react-router-dom";
import "./index.css";

const { Title, Text } = Typography;
const { TabPane } = Tabs;
const { Option } = Select;

const Profile: FC = () => {
    const [isEditingProfile, setIsEditingProfile] = useState(false);
    const [activeTab, setActiveTab] = useState("1");
    const location = useLocation();

    useEffect(() => {
        const params = new URLSearchParams(location.search);
        const tab = params.get("tab");
        if (tab) {
            setActiveTab(tab);
        }
    }, [location]);

    // Dane użytkownika
    const userData = {
        id: 1,
        imie: "Jan",
        nazwisko: "Kowalski",
        email: "jan.kowalski@example.com",
        telefon: "+48 123 456 789",
        adres: "ul. Przykładowa 15, 00-001 Warszawa",
        dataRejestracji: "01.06.2023",
        avatar: "/api/placeholder/150/150",
        poziomKonta: "Premium",
        punktyLojalnosciowe: 850
    };

    // Historia wypożyczeń
    const historiaWypozyczen = [
        {
            id: "WYP-2025-04-001",
            samochod: "BMW X5",
            dataOdbioru: "10.03.2025",
            dataZwrotu: "15.03.2025",
            status: "zakończone",
            cena: 1750,
            ocena: 5
        },
        {
            id: "WYP-2025-03-089",
            samochod: "Audi A6",
            dataOdbioru: "20.02.2025",
            dataZwrotu: "22.02.2025",
            status: "zakończone",
            cena: 840,
            ocena: 4
        },
        {
            id: "WYP-2025-02-123",
            samochod: "Mercedes C-Class",
            dataOdbioru: "15.04.2025",
            dataZwrotu: "20.04.2025",
            status: "nadchodzące",
            cena: 1400,
            ocena: null
        }
    ];

    // Ulubione samochody
    const ulubioneSamochody = [
        {
            id: 1,
            nazwa: "BMW X5",
            kategoria: "SUV",
            cena: 350,
            image: "data:image/jpeg;base64,",
            dostepny: true
        },
        {
            id: 2,
            nazwa: "Audi A8",
            kategoria: "Sedan",
            cena: 420,
            image: "data:image/jpeg;base64,",
            dostepny: false
        },
        {
            id: 3,
            nazwa: "Tesla Model 3",
            kategoria: "Elektryczny",
            cena: 390,
            image: "data:image/jpeg;base64,",
            dostepny: true
        }
    ];

    // Kolumny tabeli historii wypożyczeń
    const columns = [
        {
            title: 'ID Rezerwacji',
            dataIndex: 'id',
            key: 'id',
            width: '15%',
        },
        {
            title: 'Samochód',
            dataIndex: 'samochod',
            key: 'samochod',
            width: '15%',
        },
        {
            title: 'Data odbioru',
            dataIndex: 'dataOdbioru',
            key: 'dataOdbioru',
            width: '12%',
        },
        {
            title: 'Data zwrotu',
            dataIndex: 'dataZwrotu',
            key: 'dataZwrotu',
            width: '12%',
        },
        {
            title: 'Status',
            dataIndex: 'status',
            key: 'status',
            width: '15%',
            render: (status: string) => {
                let color = 'default';
                let icon = null;

                if (status === 'zakończone') {
                    color = 'success';
                    icon = <CheckCircleFilled />;
                } else if (status === 'nadchodzące') {
                    color = 'processing';
                    icon = <ClockCircleFilled />;
                }

                return (
                    <Tag color={color} icon={icon}>
                        {status.toUpperCase()}
                    </Tag>
                );
            },
        },
        {
            title: 'Cena (PLN)',
            dataIndex: 'cena',
            key: 'cena',
            width: '10%',
            render: (cena: number) => `${cena} zł`,
        },
        {
            title: 'Ocena',
            dataIndex: 'ocena',
            key: 'ocena',
            width: '10%',
            render: (ocena: number | null) => {
                if (ocena === null) {
                    return "-";
                }
                return (
                    <Space>
                        <StarFilled style={{ color: '#faad14' }} />
                        <span>{ocena}/5</span>
                    </Space>
                );
            },
        },
        {
            title: 'Akcje',
            key: 'action',
            width: '11%',
            render: (record: any) => (
                <Space size="small">
                    <Button type="link" size="small">Szczegóły</Button>
                    {record.status === 'zakończone' && record.ocena === null && (
                        <Button type="link" size="small">Oceń</Button>
                    )}
                    {record.status === 'nadchodzące' && (
                        <Button type="link" size="small" danger>Anuluj</Button>
                    )}
                </Space>
            ),
        },
    ];

    const handleTabChange = (key: string) => {
        setActiveTab(key);
        const url = new URL(window.location.href);
        url.searchParams.set('tab', key);
        window.history.pushState({}, '', url);
    };

    return (
        <div className="profile-container">
            <Row gutter={[24, 24]}>
                {/* Lewa kolumna - dane użytkownika */}
                <Col xs={24} md={8}>
                    <Card className="profile-card">
                        <div className="profile-header">
                            <Avatar size={96} src={userData.avatar} icon={<UserOutlined />} />
                            <div className="profile-badges">
                                <Badge.Ribbon text={userData.poziomKonta} color="blue" />
                            </div>
                        </div>

                        <Title level={3} className="user-name">
                            {userData.imie} {userData.nazwisko}
                        </Title>

                        <div className="loyalty-section">
                            <div className="loyalty-header">
                                <Text strong>Program lojalnościowy</Text>
                                <Text className="loyalty-points">{userData.punktyLojalnosciowe} punktów</Text>
                            </div>
                            <Progress percent={85} showInfo={false} strokeColor="#1890ff" />
                            <Text type="secondary">Zbierz jeszcze 150 punktów, aby otrzymać zniżkę 10%</Text>
                        </div>

                        <Divider />

                        <div className="contact-info">
                            <div className="info-item">
                                <MailOutlined className="info-icon" />
                                <Text>{userData.email}</Text>
                            </div>
                            <div className="info-item">
                                <PhoneOutlined className="info-icon" />
                                <Text>{userData.telefon}</Text>
                            </div>
                            <div className="info-item">
                                <UserOutlined className="info-icon" />
                                <Text>Klient od: {userData.dataRejestracji}</Text>
                            </div>
                        </div>

                        <Button
                            type="primary"
                            icon={<EditOutlined />}
                            block
                            className="edit-profile-btn"
                            onClick={() => setIsEditingProfile(!isEditingProfile)}
                        >
                            Edytuj profil
                        </Button>
                    </Card>
                </Col>

                {/* Prawa kolumna - zakładki */}
                <Col xs={24} md={16}>
                    <Card className="tabs-card">
                        <Tabs activeKey={activeTab} onChange={handleTabChange}>
                            {/* Dane osobowe */}
                            <TabPane
                                tab={<span className="tab-with-icon"><UserOutlined /><span>Dane osobowe</span></span>}
                                key="1"
                            >
                                {!isEditingProfile ? (
                                    <div className="profile-details">
                                        <Title level={4}>Dane kontaktowe</Title>
                                        <Row gutter={[24, 24]}>
                                            <Col xs={24} md={12}>
                                                <div className="detail-item">
                                                    <Text type="secondary">Imię</Text>
                                                    <Text strong>{userData.imie}</Text>
                                                </div>
                                            </Col>
                                            <Col xs={24} md={12}>
                                                <div className="detail-item">
                                                    <Text type="secondary">Nazwisko</Text>
                                                    <Text strong>{userData.nazwisko}</Text>
                                                </div>
                                            </Col>
                                            <Col xs={24} md={12}>
                                                <div className="detail-item">
                                                    <Text type="secondary">Email</Text>
                                                    <Text strong>{userData.email}</Text>
                                                </div>
                                            </Col>
                                            <Col xs={24} md={12}>
                                                <div className="detail-item">
                                                    <Text type="secondary">Telefon</Text>
                                                    <Text strong>{userData.telefon}</Text>
                                                </div>
                                            </Col>
                                            <Col xs={24}>
                                                <div className="detail-item">
                                                    <Text type="secondary">Adres</Text>
                                                    <Text strong>{userData.adres}</Text>
                                                </div>
                                            </Col>
                                        </Row>

                                        <Title level={4} className="mt-large">Preferencje</Title>
                                        <Row gutter={[24, 24]}>
                                            <Col xs={24} md={12}>
                                                <div className="detail-item">
                                                    <Text type="secondary">Preferowana klasa samochodu</Text>
                                                    <Text strong>Premium</Text>
                                                </div>
                                            </Col>
                                            <Col xs={24} md={12}>
                                                <div className="detail-item">
                                                    <Text type="secondary">Preferowana lokalizacja odbioru</Text>
                                                    <Text strong>Warszawa Centrum</Text>
                                                </div>
                                            </Col>
                                        </Row>
                                    </div>
                                ) : (
                                    <Form layout="vertical">
                                        <Row gutter={[24, 0]}>
                                            <Col xs={24} md={12}>
                                                <Form.Item label="Imię" name="imie" initialValue={userData.imie}>
                                                    <Input />
                                                </Form.Item>
                                            </Col>
                                            <Col xs={24} md={12}>
                                                <Form.Item label="Nazwisko" name="nazwisko" initialValue={userData.nazwisko}>
                                                    <Input />
                                                </Form.Item>
                                            </Col>
                                            <Col xs={24} md={12}>
                                                <Form.Item label="Email" name="email" initialValue={userData.email}>
                                                    <Input type="email" />
                                                </Form.Item>
                                            </Col>
                                            <Col xs={24} md={12}>
                                                <Form.Item label="Telefon" name="telefon" initialValue={userData.telefon}>
                                                    <Input />
                                                </Form.Item>
                                            </Col>
                                            <Col xs={24}>
                                                <Form.Item label="Adres" name="adres" initialValue={userData.adres}>
                                                    <Input />
                                                </Form.Item>
                                            </Col>
                                            <Col xs={24} md={12}>
                                                <Form.Item
                                                    label="Nowe hasło"
                                                    name="password"
                                                    rules={[{ min: 8, message: 'Hasło musi mieć co najmniej 8 znaków' }]}
                                                >
                                                    <Input.Password prefix={<LockOutlined />} />
                                                </Form.Item>
                                            </Col>
                                            <Col xs={24} md={12}>
                                                <Form.Item
                                                    label="Powtórz hasło"
                                                    name="passwordConfirm"
                                                    dependencies={['password']}
                                                    rules={[
                                                        ({ getFieldValue }) => ({
                                                            validator(_, value) {
                                                                if (!value || getFieldValue('password') === value) {
                                                                    return Promise.resolve();
                                                                }
                                                                return Promise.reject(new Error('Hasła nie są identyczne!'));
                                                            },
                                                        }),
                                                    ]}
                                                >
                                                    <Input.Password prefix={<LockOutlined />} />
                                                </Form.Item>
                                            </Col>
                                        </Row>
                                        <Form.Item>
                                            <Space>
                                                <Button type="primary" htmlType="submit">Zapisz zmiany</Button>
                                                <Button onClick={() => setIsEditingProfile(false)}>Anuluj</Button>
                                            </Space>
                                        </Form.Item>
                                    </Form>
                                )}
                            </TabPane>

                            {/* Historia wypożyczeń */}
                            <TabPane
                                tab={<span className="tab-with-icon"><HistoryOutlined /><span>Historia wypożyczeń</span></span>}
                                key="2"
                            >
                                <Title level={4}>Twoje wypożyczenia</Title>
                                <div className="table-responsive">
                                    <Table
                                        dataSource={historiaWypozyczen}
                                        columns={columns}
                                        rowKey="id"
                                        pagination={false}
                                        className="rental-history-table"
                                        scroll={{ x: 800 }}
                                    />
                                </div>
                            </TabPane>

                            {/* Ulubione samochody */}
                            <TabPane
                                tab={<span className="tab-with-icon"><HeartOutlined /><span>Ulubione</span></span>}
                                key="3"
                            >
                                <Title level={4}>Twoje ulubione samochody</Title>
                                <List
                                    itemLayout="horizontal"
                                    dataSource={ulubioneSamochody}
                                    renderItem={item => (
                                        <List.Item
                                            actions={[
                                                <Button type="primary" disabled={!item.dostepny}>
                                                    {item.dostepny ? "Wypożycz" : "Niedostępny"}
                                                </Button>,
                                                <Button type="text" danger icon={<HeartOutlined />} />
                                            ]}
                                        >
                                            <List.Item.Meta
                                                avatar={<img src={item.image} alt={item.nazwa} className="car-thumbnail" />}
                                                title={<Text strong>{item.nazwa}</Text>}
                                                description={
                                                    <Space direction="vertical" size={0}>
                                                        <Text type="secondary">{item.kategoria}</Text>
                                                        <Text className="price-text">{item.cena} zł<span className="price-day">/dzień</span></Text>
                                                    </Space>
                                                }
                                            />
                                            <div>
                                                <Tag color={item.dostepny ? "success" : "error"}>
                                                    {item.dostepny ? "Dostępny" : "Niedostępny"}
                                                </Tag>
                                            </div>
                                        </List.Item>
                                    )}
                                />
                            </TabPane>

                            {/* Ustawienia */}
                            <TabPane
                                tab={<span className="tab-with-icon"><SettingOutlined /><span>Ustawienia</span></span>}
                                key="4"
                            >
                                <Title level={4}>Ustawienia konta</Title>
                                <Form layout="vertical">
                                    <Form.Item label="Powiadomienia e-mail" name="emailNotifications" initialValue={true}>
                                        <Row>
                                            <Col xs={24}>
                                                <Form.Item name="emailPromo" valuePropName="checked" noStyle>
                                                    <Checkbox>Otrzymuj informacje o promocjach</Checkbox>
                                                </Form.Item>
                                            </Col>
                                            <Col xs={24}>
                                                <Form.Item name="emailReminders" valuePropName="checked" noStyle>
                                                    <Checkbox>Otrzymuj przypomnienia o rezerwacjach</Checkbox>
                                                </Form.Item>
                                            </Col>
                                            <Col xs={24}>
                                                <Form.Item name="emailNews" valuePropName="checked" noStyle>
                                                    <Checkbox>Otrzymuj newsletter</Checkbox>
                                                </Form.Item>
                                            </Col>
                                        </Row>
                                    </Form.Item>

                                    <Form.Item label="Preferencje" name="preferences">
                                        <Row gutter={[24, 0]}>
                                            <Col xs={24} md={12}>
                                                <Form.Item label="Preferowana klasa samochodu" name="preferredCarClass">
                                                    <Select defaultValue="premium">
                                                        <Option value="economy">Ekonomiczna</Option>
                                                        <Option value="standard">Standardowa</Option>
                                                        <Option value="premium">Premium</Option>
                                                        <Option value="suv">SUV</Option>
                                                    </Select>
                                                </Form.Item>
                                            </Col>
                                            <Col xs={24} md={12}>
                                                <Form.Item label="Preferowana lokalizacja odbioru" name="preferredLocation">
                                                    <Select defaultValue="warszawa-centrum">
                                                        <Option value="warszawa-centrum">Warszawa Centrum</Option>
                                                        <Option value="warszawa-okecie">Warszawa Okęcie</Option>
                                                        <Option value="krakow">Kraków</Option>
                                                        <Option value="gdansk">Gdańsk</Option>
                                                    </Select>
                                                </Form.Item>
                                            </Col>
                                        </Row>
                                    </Form.Item>

                                    <Divider />

                                    <Form.Item>
                                        <Button type="primary" htmlType="submit">Zapisz ustawienia</Button>
                                    </Form.Item>
                                </Form>
                            </TabPane>
                        </Tabs>
                    </Card>
                </Col>
            </Row>
        </div>
    );
};

export default Profile;